import React from "react";
import Input from "./Input.js"
import Login from "./Login.js"


var userIsRegistered = false;


function Form(props) {
  return (
    <form className="form">
      {props.userIsRegistered ? <Input /> : <Login />}
    </form>
  );
}

export default Form;
